    /**
     * 获取各项最大需量及发生时间数据
     */
    public function getData($name, $day = "当前")
    {
        if (!in_array($name, array_keys(self::DIs))) {
            return false;
        }
        $di = self::DIs[$name];
        if (!strpos("r", $di[5]) === false) { //本项目不可读
            return false;
        }
        if (!in_array($day, array_keys(self::DAYS_DI0))) {
            return false;
        }
        $di[3] = self::DAYS_DI0[$day]; //最后一项不可用，使用$day替换
        $this->exec($name, '11', $di);
        if ($this->response->success) {
            return tool::caclResponses($di[4], $this->response->NData);
        }
        return false;
    }
